import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import '@fortawesome/fontawesome-free/css/all.min.css';
import 'bootstrap-css-only/css/bootstrap.min.css';
import 'mdbreact/dist/css/mdb.css';
import App from './modules/app/components/App';
import * as serviceWorker from './serviceWorker';
import { AuthContextProvider }from './modules/auth/Auth';
import firebase from 'firebase';

const firebaseConfig = {
  apiKey: "AIzaSyBT-SSwliuMgEp-34TkJ36oEFwhBmJ5b9Y",
  authDomain: "maisonette.firebaseapp.com",
  projectId: "maisonette",
  storageBucket: "maisonette.appspot.com",
  messagingSenderId: "437926567836",
  appId: "1:437926567836:web:8495b5436af9b7b2ac7259",
  measurementId: "G-VDH4Y2Z78Q"
};

// apiKey: "AIzaSyDsDk2c6gnegcse_NF2a6a6GZiOonc5EgE",
//     authDomain: "maisonette-dev-d9027.firebaseapp.com",
//     projectId: "maisonette-dev-d9027",
//     storageBucket: "maisonette-dev-d9027.appspot.com",
//     messagingSenderId: "490163261516",
//     appId: "1:490163261516:web:3bb05b509110085505e4e9",
//     measurementId: "G-TRZV56F4HP"
firebase.initializeApp(firebaseConfig);
firebase.analytics();

ReactDOM.render(
  <React.StrictMode>
    <AuthContextProvider>
      <App />
    </AuthContextProvider>
  </React.StrictMode>,
  document.getElementById('root')
);
